About: Margo, divorced, young and beautiful is unsatisfied with her life. She needs a change, new experiences. She publishes a small ad in a newspaper for partner -swapping asking for a young woman who looks to live the same experience. A nice and sensual woman answers to her small ad. They meet and decide to make love with the husband of one of Margo's friend. The resulting situations reach the summits of sensuality and eroticism! Those two exciting and superb women will go to your head. Believe it!
